using System;
using System.IO;
using System.IO.Compression;

public class Program
{
  public static void Main()
  {
    string image = @"";
    byte[] unzippedLabel = Unzip(image);
    Console.WriteLine(Convert.ToBase64String(unzippedLabel));
  }

  public static byte[] Unzip(String input)
  {
	  input = input + new String('=',4-input.Length%4);
      using (var msi = new MemoryStream(Convert.FromBase64String(input)))
      using (var mso = new MemoryStream())
      {
          using (var gs = new GZipStream(msi, CompressionMode.Decompress))
          {
              CopyTo(gs, mso);
          }

          return (mso.ToArray());
      }
  }

  public static void CopyTo(Stream src, Stream dest)
  {
      byte[] bytes = new byte[4096];

      int cnt;

      while ((cnt = src.Read(bytes, 0, bytes.Length)) != 0)
      {
          dest.Write(bytes, 0, cnt);
      }
  }
}
